import React, { Component } from "react";
import axios from "axios";

class Silkum extends Component {
  componentDidMount() {}

  List() {
    axios
      .get("http://seeho.kro.kr:3010/json")
      .then(function(res) {
        return res.data.map((data, i) =>{
            return (
                <div>
                hi. List {i}. {data}
                </div>
            )
        })
      })
      .catch(function(err) {
        console.log(err);
      });
  }
  render() {
    console.log("ㅇ");
    return (
      <>
        {this.List()}
      </>
    );
  }
}

export default Silkum;
